const routes = [
    {
        path: 'home',
        routes: [
            {
                path: "/home/news",
                content: 'News'
            },
            {
                path: "/home/stores",
                content: 'Stores'
            },
            {
                path: "/home/about",
                content: 'About'
            },
            {
                path: "/home/contact",
                content: 'Contact'
            }
        ]
    },
    {
        path: 'menu',
        routes: [
            {
                path: "/menu/pizza",
                content: 'Pizza'
            },
            {
                path: "/menu/drinks",
                content: 'Drinks'
            },
            {
                path: "/home/cake",
                content: 'Cake'
            }
        ]
    },
];

export default routes;
